import React from "react";
import Logo from "../images/logo2.jpg";

 const Header = () => {
  return (
    <header className="header">
      <div className="logo">
        <img src={Logo} alt="логотип" className="logo__image" />
      </div>
    </header>
  );
};

export default Header;
